  return (
    <div className="plan">

      <ul>
        <li>四人套房。</li>
        <li>腹地優美，活動場域設備加級完善，讓學員放心安靜休息。</li>
        <li>每日巡房，隨時注意學員安全，加強營區全面之消毒與環境衛生。</li>
      </ul>

    </div>
  );
};

